import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h1>I am contact</h1>
        <img src="https://sites.wp.odu.edu/bwyskocilhlth101/wp-content/uploads/sites/9341/2018/09/Contact-Me.jpg" />
      </div>
    );
  }
}

export default Contact;
